import React from 'react'

const MovieOne = ({ data }) => {

    const content = data.list;
    const loading = data.loading;
    const page_title=data.list.page.title;
    console.log(content)
    return (
        <div>
            <h1>page_title</h1>
            {loading}
            <pre>
                {JSON.stringify(data)}
            </pre>

        </div>
    )
}

export default MovieOne
